CREATE TABLE Districts (id INT PRIMARY KEY, name VARCHAR(255), population INT);
CREATE TABLE Precincts (id INT PRIMARY KEY, name VARCHAR(255), district_id INT);
CREATE TABLE Voters (id INT PRIMARY KEY, name VARCHAR(255), age INT, precinct_id INT);
CREATE TABLE Ethnicity (id INT PRIMARY KEY, voter_id INT, ethnicity VARCHAR(255));
CREATE TABLE Income (id INT PRIMARY KEY, voter_id INT, income INT);
